import React from "react";

const UserForm = (props) => {
  return (
    <div>
      <form>
        <label>Username</label>
        <input type="text" />
        <label>Age (Years)</label>
        <input type="number" min="16" max="100" step="1" />
        <button type="submit">Add User</button>
      </form>
    </div>
  );
};

export default UserForm;
